INSERT INTO `query_new` VALUES (1,'pay',0,'充值流水','服务器,关联帐号,角色ID,VIP等级,角色名,充值平台,充值订单,渠道订单,充值通道,下载渠道,订单时间,完成时间,充值金额,充值金币,状态,备注,IP,渠道key,充值类型','','','last_time',1,'SELECT s.id,open_id,pay_user,vip_level,player_name,pc.func_name,query_id ,order_id,\r\n pa.payType AS pay_channel_name,\r\nc.name AS  channel_name,post_time,pa.last_time,pay_amount,pay_gold ,pay_status ,pa.remark,pay_ip ,pa.channel_key,pa.charge_id\r\nFROM pay_action pa\r\nLEFT JOIN pay_channel pc ON pa.pay_type = pc.id LEFT JOIN channel c ON pa.channel_id = c.id\r\nLEFT JOIN servers s ON pa.server_id=s.id \r\n WHERE   pa.channel_id IN ({{channel_ids}}) AND pa.post_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\' \r\n AND pa.server_id IN ({{server_ids}})\r\n AND pa.query_id=\'{{充值订单}}\' AND pa.order_id=\'{{渠道订单}}\'\r\n AND pay_status IN ({{状态}})\r\n AND pa.pay_user in ({{角色ID}})\r\n AND pa.open_id=\'{{关联帐号}}\'\r\n AND pa.charge_id in ({{充值类型}})\r\n ','2014-09-04 19:52:11',1,'','{\"渠道订单\":{\"name\":\"pa.query_id\",\"dict\":\"\",\"sort\":false,\"multiple\":false,\"search\":true,\"merge_value\":false,\"single\":false,\"fixed\":false,\"order_num\":2},\"状态\":{\"name\":\"pay_status\",\"dict\":\"{\\\"0\\\": \\\"已提交,未支付\\\", \\\"1\\\": \\\"已转发,未回复\\\", \\\"2\\\": \\\"已支付,金币发放中\\\", \\\"3\\\": \\\"金币发放中\\\", \\\"4\\\": \\\"充值成功,金币已发放\\\", \\\"-2\\\": \\\"游戏服连接失败\\\",\\\"-4\\\":\\\"游戏返回失败\\\", \\\"5\\\": \\\"充值异常\\\"}\",\"sort\":false,\"multiple\":true,\"search\":true,\"merge_value\":false,\"single\":false,\"fixed\":false,\"order_num\":3},\"充值订单\":{\"name\":\"pa.order_id\",\"dict\":\"\",\"sort\":false,\"multiple\":false,\"search\":true,\"merge_value\":false,\"single\":false,\"fixed\":false,\"order_num\":1},\"充值类型\":{\"name\":\"charge_id\",\"dict\":\"recharge_type\",\"sort\":false,\"multiple\":true,\"search\":true,\"merge_value\":false,\"single\":false,\"fixed\":false,\"order_num\":0},\"完成时间\":{\"name\":\"last_time\",\"dict\":\"\",\"sort\":true,\"multiple\":false,\"search\":false,\"merge_value\":false,\"single\":false,\"fixed\":false,\"order_num\":0},\"角色ID\":{\"name\":\"pay_user\",\"dict\":\"\",\"sort\":false,\"multiple\":false,\"search\":true,\"merge_value\":false,\"single\":false,\"fixed\":false,\"order_num\":1},\"关联帐号\":{\"name\":\"open_id\",\"dict\":\"\",\"sort\":false,\"multiple\":false,\"search\":true,\"merge_value\":false,\"single\":false,\"fixed\":false,\"order_num\":1},\"订单时间\":{\"name\":\"post_time\",\"dict\":\"\",\"sort\":true,\"multiple\":false,\"search\":false,\"merge_value\":false,\"single\":false,\"fixed\":false,\"order_num\":0}}','','SELECT \'总计\',\'\'a,\r\n\'\' b,\'\' c,\'\'d, \'\' e ,\'\' f,\r\n\'\'g,\r\n\'\' h,\r\n\'\' i,\'\' j,SUM(pay_amount),SUM(pay_gold) ,\'\'j ,\'\' k,\'\' l ,\'\' m, \'\' n\r\nFROM pay_action pa\r\nLEFT JOIN pay_channel pc ON pa.pay_type = pc.id LEFT JOIN channel c ON pa.channel_id = c.id\r\nLEFT JOIN servers s ON pa.server_id=s.id \r\n WHERE   pa.channel_id IN ({{channel_ids}}) AND pa.post_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\' \r\n AND pa.server_id IN ({{server_ids}})\r\n AND pa.query_id=\'{{充值订单}}\' AND pa.order_id=\'{{渠道订单}}\'\r\n AND pay_status IN ({{状态}})\r\n AND pa.pay_user in ({{角色ID}})\r\n AND pa.open_id=\'{{关联帐号}}\'\r\n '),(121,'pay',0,'渠道充值比率','渠道,渠道key,充值金额,充值钻石,总金额,总钻石,金额比率,钻石比率','','','',0,'SELECT channel_id,channel_key, channel_amount, channel_gold, total_amount, total_gold, amount_persent, gold_persent\r\nFROM (\r\n  SELECT a.channel_id,a.channel_key, a.channel_amount, a.channel_gold, b.total_amount, b.total_gold, \r\n  FORMAT((a.channel_amount/b.total_amount)*100,2) AS amount_persent, \r\n  FORMAT((a.channel_gold/b.total_gold)*100,2) AS gold_persent\r\n   FROM (\r\n      SELECT channel_id,channel_key, SUM(pay_amount) AS `channel_amount` , SUM(pay_gold) AS `channel_gold`  \r\n      FROM pay_action   WHERE pay_status = 4 and channel_id IN ({{channel_ids}}) and server_id IN ({{server_ids}}) GROUP BY channel_key\r\n         ) AS a, \r\n         (\r\n      SELECT SUM(pay_amount) AS total_amount, SUM(pay_gold) AS total_gold FR