\":\"dd\",\"dict\":\"\",\"sort\":true,\"multiple\":false,\"search\":false,\"merge_value\":false,\"single\":false,\"fixed\":false,\"order_num\":0},\"登录用户数\":{\"name\":\"ln\",\"dict\":\"\",\"sort\":true,\"multiple\":false,\"search\":false,\"merge_value\":false,\"single\":false,\"fixed\":false,\"order_num\":0},\"新增用户数\":{\"name\":\"na\",\"dict\":\"\",\"sort\":true,\"multiple\":false,\"search\":false,\"merge_value\":false,\"single\":false,\"fixed\":false,\"order_num\":0},\"角色创建流失率\":{\"name\":\"lost_p\",\"dict\":\"\",\"sort\":true,\"multiple\":false,\"search\":false,\"merge_value\":false,\"single\":false,\"fixed\":false,\"order_num\":0}}','chart_e','SELECT \'合计\' AS dd,ln,na,rc,\r\nCONCAT(FORMAT((na-rc)/na*100,2),\'%%\')  AS lost_p\r\n FROM\r\n(\r\n    SELECT \r\n   CONVERT(SUM(IF(log_type=<<日登录>>,log_now,0)),SIGNED) AS ln, \r\n   CONVERT(SUM(IF(log_type=<<时新增注册>>,log_now,0)),SIGNED) AS na, \r\n   CONVERT(SUM(IF(log_type=<<时新增角色>>,log_now,0)),SIGNED) AS rc \r\n  FROM log_statistic_result \r\n  WHERE log_time>=\'{{sdate}}\' AND log_time<=\'{{edate}}\' AND log_server IN ({{server_ids}}) AND log_channel IN ({{channel_ids}})  \r\n) d'),(155,'statistic_result',0,'创建时段统计','时段,注册数,创建角色数','','','',0,'SELECT DATE_FORMAT(ld.log_time,\'{{时段}}\') as dd,SUM(IFNULL(a.cn,0)) cn,SUM(IFNULL(a.rc,0)) rc \r\n FROM (\r\n    SELECT log_time,\r\n   CONVERT(SUM(IF(log_type=<<时新增角色>>,log_now,0)),SIGNED) AS rc ,\r\n      CONVERT(SUM(IF(log_type=<<时新增注册>>,log_now,0)),SIGNED) AS cn \r\n FROM log_statistic_result \r\n  WHERE log_time>=\'{{sdate}}\' AND log_time<=\'{{edate}}\' AND log_server IN ({{server_ids}}) AND log_channel IN({{channel_ids}}) \r\n    GROUP BY log_time\r\n) a RIGHT JOIN log_statistic_date ld ON ld.log_time=a.log_time\r\nWHERE ld.log_time>=\'{{sdate}}\' AND ld.log_time<=\'{{edate}}\'\r\nGROUP BY dd\r\n\r\n','2014-09-10 11:15:20',0,'以小时为单位，列出指定时间段的角色创建数量（以选择初始武将创建角色资料为完成角色创建标准），并统计总数。可以以天为单位指定统计时间段，如指定多天则分页列出。   ','{\"创建角色数\":{\"name\":\"rc\",\"dict\":\"\",\"sort\":true,\"multiple