 hh,\r\n    CONVERT(SUM(IF(log_type=<<时登录>>,log_previous,0)),SIGNED) AS tln,\r\n    \'100%%\' AS bili \r\n    FROM log_statistic_result\r\n      WHERE log_time>=\'{{sdate}}\' AND log_time<=\'{{edate}}\' AND log_server IN ({{server_ids}}) AND log_channel IN({{channel_ids}}) '),(158,'statistic_result',0,'在线趋势统计','时段,在线','','','',0,'SELECT dd,ROUND(rc)\r\n FROM (\r\n    SELECT DATE_FORMAT(log_time,\'{{时段}}\') as dd,\r\n   {{统计项}}(IF(log_type=<<时在线人数>>,log_now,0)) AS rc \r\n  FROM log_statistic_result \r\n  WHERE log_time>=\'{{sdate}}\' AND log_time<=\'{{edate}}\' AND log_server IN ({{server_ids}}) AND log_channel IN({{channel_ids}}) \r\n GROUP BY dd\r\n) a\r\n','2014-09-11 19:05:35',0,'在线趋势         \r\n以小时/天/每天最高值为单位绘出指定时间段内平均在线/最高值的数据曲线图          \r\n起始、截止时间可指定，单位可选每小时平均、每天平均、每天最高          \r\n','{\"时段\":{\"name\":\"dd\",\"dict\":\"{\\\"%Y-%m-%d %H时\\\":\\\"时\\\",\\\"%Y-%m-%d\\\":\\\"日\\\"}\",\"sort\":true,\"multiple\":false,\"search\":true,\"merge_value\":false,\"single\":true,\"fixed\":false,\"order_num\":0},\"统计项\":{\"name\":\"tt\",\"dict\":\"{\\\"AVG\\\":\\\"平均\\\",\\\"MAX\\\":\\\"最高\\\"}\",\"sort\":false,\"multiple\":false,\"search\":true,\"merge_value\":true,\"single\":true,\"fixed\":false,\"order_num\":0}}','chart',''),(165,'statistic_result',0,'游戏流失率','日期,流失角色数,角色总数,标准流失率,昨天登录玩家数,昨天今天都有登录的玩家数,次日流失率','','','',0,'SELECT dd,lsn,r_t,CONCAT(if(lsn,FORMAT(lsn/r_t*100,2),0),\'%%\'),\r\nIFNULL(CONVERT(ln,SIGNED),0),IFNULL(CONVERT(2ln,SIGNED),0),CONCAT(IFNULL(FORMAT((ln-2ln)/ln*100,2),0),\'%%\')\r\nFROM \r\n(\r\n   SELECT dd,lsn, r_t,\r\n  (SELECT SUM(log_now) FROM log_statistic_result WHERE log_type=<<日登录>> AND DATE(log_time)=ADDDATE(dd,-1)\r\n    AND log_server IN ({{server_ids}}) AND log_channel IN({{channel_ids}}) \r\n  ) as ln,\r\n  (SELECT SUM(log_now) FROM log_statistic_result WHERE log_type=<<连续2日登录>> AND DATE(log_time)=ADDDATE(dd,-1)\r\n   AND log_server IN ({{server_ids}}) AND log_channel IN({{channel_ids}}) \r\n  )as 2ln\r\n   FROM (\r\n   SELECT DATE(log_time) as dd,\r\n    CONVERT(SUM(IF(log_type=<<3日流失角色数>>,log_now,0)),SIGNED) AS lsn,\r\n   CONVERT(SUM(IF(log_type=<<日角色总数>>,log_now,0)),SIGNED) AS r_t\r\n    FROM log_statistic_result \r\n    WHERE log_time>=\'{{sdate}}\' AND log_time<=\'{{edate}}\' AND log_server IN ({{server_ids}}) AND log_channel IN({{channel_ids}}) \r\n   GROUP BY dd\r\n  ) a\r\n)b','2014-09-12 18:50:52',5,'流失用户数=最近3天内没有登录游戏的角色数\r\n标准流失率=流失角色数/角色总数\r\n次日流失率=(昨天登陆玩家数-昨天今天都有登录的玩家数)/昨天登陆玩家数\r\n','{\"日期\":{\"name\":\"dd\",\"dict\":\"{\\\"%%Y-%%m-%%d %%H时\\\":\\\"时\\\",\\\"%%Y-%%m-%%d\\\":\\\"日\\\"}\",\"sort\":true,\"multiple\":false,\"search\":false,\"merge_value\":false,\"single\":false,\"fixed\":false,\"order_num\":0}}','chart',''),(166,'statistic_result',0,'在线时长统计','日期,5分钟以内,5-30分钟,31-60分钟,1-2小时,2-3小时,3-5小时,5-8小时,8小时以上','','','',0,'SELECT DATE(log_time) as dd,\r\nCONVERT(SUM(IF(log_type=<<日在线时长>> AND log_tag=1,log_now,0)),SIGNED) AS lo1, \r\nCONVERT(SUM(IF(log_type=<<日在线时长>> AND log_tag=2,log_now,0)),SIGNED) AS lo2, \r\nCONVERT(SUM(IF(log_type=<<日在线时长>> AND log_tag=3,log_now,0)),SIGNED) AS lo3, \r\nCONVERT(SUM(IF(log_type=<<日在线时长>> AND log_tag=4,log_now,0)),SIGNED) AS lo4, \r\nCONVERT(SUM(IF(log_type=<<日在线时长>> AND log_tag=5,log_now,0)),SIGNED) AS lo5, \r\nCONVERT(SUM(IF(log_type=<<日在线时长>> AND log_tag=6,log_now,0)),SIGNED) AS lo6, \r\nCONVERT(SUM(IF(log_type=<<日在线时长>> AND log_tag=7,log_now,0)),SIGNED) AS lo7, \r\nCONVERT(SUM(IF(log_type=<<日在线时长>> AND log_tag=8,log_now,0)),SIGNED) AS lo8\r\nFROM log_statistic_result \r\nWHERE log_time>=\'{{sdate}}\' AND log_time<=\'{{edate}}\' AND log_server IN ({{server_ids}}) AND log_channel IN({{channel_ids}}) \r\nGROUP BY dd\r\n\r\n','2014-09-12 20:29:30',0,'','{\"\\u65e5\\u671f\": {\"sort\": true, \"search\": false, \"multiple\": false, \"name\": \"dd\", \"single\": false, \"dict\": \"\", \"order_num\": 0, \"merge_value\": false, \"fixed\": false, \"order\": true}}','chart',NULL),(167,'check_user',0,'登录次数分布','登录数量,玩家数量,比例','','','',0,'SELECT tag,CONVERT(num,SIGNED) num,CONCAT(FORMAT(num/d.tol*100,2),\'%\') AS bl\r\nFROM\r\n(\r\n  SELECT tag,COUNT(log_user) as num\r\n FROM\r\n  (\r\n   SELECT log_user,\r\n    CASE \r\n   WHEN o_n=1 THEN \'1次\'\r\n    WHEN o_n=2 THEN \'2次\'\r\n    WHEN o_n=3  THEN \'3次\'\r\n   WHEN o_n BETWEEN 4 AND 5 THEN \'4-5次\'\r\n    WHEN o_n BETWEEN 6 AND 10 THEN \'6-10次\'\r\n    WHEN o_n BETWEEN 11 AND 15 THEN \'11-15次\'\r\n    WHEN o_n BETWEEN 16 AND 20 THEN \'16-20次\'\r\n    WHEN o_n BETWEEN 21 AND 30 THEN \'21-30次\'\r\n    WHEN o_n BETWEEN 31 AND 50 THEN \'31-50次\'\r\n    WHEN o_n BETWEEN 51 AND 100 THEN \'51-100次\'\r\n    WHEN o_n BETWEEN 101 AND 200 THEN \'101-200次\'\r\n    ELSE \'200次以上\'\r\n   END as tag\r\n    FROM \r\n   (\r\n     SELECT log_user,COUNT(log_user) o_n\r\n     FROM log_check_user c\r\n     WHERE log_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\' AND log_user NOT IN ({{neibuhao}})\r\n     GROUP BY log_user\r\n   ) a\r\n ) b\r\n GROUP BY tag\r\n) c,(\r\nSELECT log_user,COUNT(DISTINCT log_user) tol\r\nFROM log_check_user c\r\nWHERE log_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\'  AND log_user NOT IN ({{neibuhao}})\r\n) d\r\nORDER BY num','2014-09-13 14:01:29',0,'统计指定时间段内的玩家登录次数。如一个玩家在指定时间段内登录了2次，则该玩家归类到登录2次的统计里。    \r\n','{\"标记名\":{\"name\":\"参数名\",\"dict\":\"字典定义\",\"sort\":false,\"multiple\":false,\"search\":false,\"merge_value\":true,\"single\":false,\"fixed\":false,\"order_num\":0}}','pie','SELECT \'合计\'as tag,COUNT(DISTINCT log_user) num,\'\' bl\r\nFROM log_check_user c\r\nWHERE log_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\'  AND log_user NOT IN ({{neibuhao}})\r\n'),(168,'statistic_result',0,'角色转化','日期,安装激活,账号数,角色数,当日账号转化,当日角色转化','','','',0,'SELECT dd,anzhuangjihuo,zhuce,juese,\r\nCONCAT(IFNULL(FORMAT(qczhuce/anzhuangjihuo*100,2),0),\'%%\') dangrizhanghaozhuanhua,\r\nCONCAT(IFNULL(FORMAT(zhuce/qcjuese*100,2),0),\'%%\') dangrijuesezhuanghua\r\nFROM \r\n(\r\n   SELECT dd,anzhuangjihuo,zhuce,juese,qczhuce,qcjuese\r\n   FROM (\r\n    SELECT DATE(log_time) as dd,\r\n    CONVERT(SUM(IF(log_type=<<日新增激活>>,log_now,0)),SIGNED) AS anzhuangjihuo,\r\n    CONVERT(SUM(IF(log_type=<<时新增角色>>,log_previous,0)),SIGNED) AS zhuce,\r\n   CONVERT(SUM(IF(log_type=<<时新增注册>>,log_now,0)),SIGNED) AS qcjuese,\r\n    CONVERT(SUM(IF(log_type=<<时新增角色>>,log_now,0)),SIGNED) AS juese\r\n    FROM log_statistic_result \r\n    WHERE log_time>=\'{{sdate}}\' AND log_time<=\'{{edate}}\' AND log_channel IN({{channel_ids}}) \r\n    GROUP BY dd\r\n  ) a left join(select DATE(create_time) as odd,count(DISTINCT mobile_key) qczhuce,e.id\r\n      from users d left join \r\n      (select id,channel_key from channel) e on e.channel_key = d.channel_key where mobile_key <>\"\" and create_time between \'{{sdate}}\' and \'{{edate}}\' \r\n      AND e.id IN ({{channel_ids}}) \r\n      group by odd\r\n      )c on a.dd = c.odd\r\n) b','2014-09-13 17:59:28',0,'日期 安装激活  累计激活  账号数 累计账号  角色数 累计角色  当日账号转化  当日角色转化  累计账号转化  累计角色转化\r\n','{\"日期\":{\"name\":\"dd\",\"dict\":\"\",\"sort\":true,\"multiple\":false,\"search\":false,\"merge_value\":false,\"single\":false,\"fixed\":false,\"order_num\":0}}','chart',''),(169,'statistic_result',0,'玩家数统计','日期,登录用户数,角色创建数,新注册玩家数,老玩家数,活跃玩家数,忠诚玩家数','','','',0,'SELECT dd,dengluyonghushu,chuangjuese,zhucewanjiashu,laoyonghu,huoyuewanjia,zhongchengwanjia\r\n FROM (\r\n    SELECT DATE(log_time) as dd,\r\n   CONVERT(SUM(IF(log_type=<<日登录>>,log_now,0)),SIGNED) AS dengluyonghushu, \r\n    CONVERT(SUM(IF(log_type=<<时新增注册>>,log_now,0)),SIGNED) AS zhucewanjiashu, \r\n   CONVERT(SUM(IF(log_type=<<时新增角色>>,log_now,0)),SIGNED) AS chuangjuese ,\r\n      CONVERT(SUM(IF(log_type=<<日老用户>>,log_now,0)),SIGNED) AS laoyonghu ,\r\n      CONVERT(SUM(IF(log_type=<<日在线时长>> AND log_tag>3,log_now,0)),SIGNED) AS huoyuewanjia ,\r\n      CONVERT(SUM(IF(log_type=<<日忠诚玩家数>>,log_now,0)),SIGNED) AS zhongchengwanjia \r\n FROM log_statistic_result \r\n  WHERE log_time>=\'{{sdate}}\' AND log_time<=\'{{edate}}\' AND log_server IN ({{server_ids}}) AND log_channel IN({{channel_ids}}) \r\n GROUP BY dd\r\n) a