ECT COUNT(0) num,SUM(f.surplus_gold),SUM(f.surplus_gold_ticket)\r\nFROM\r\n(SELECT DISTINCT log_user as log_user from log_check_user where log_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\' ) as a\r\nJOIN\r\n(\r\n  select c.log_user,c.surplus_gold,d.surplus_gold_ticket\r\n  from (select b.log_user log_user,b.id,b.f3 surplus_gold\r\nfrom(select * from log_player_coin order by log_time desc) b\r\nwhere b.f1 = 0 group by log_user) c\r\nLEFT JOIN\r\n(select e.log_user,e.id,e.f3 surplus_gold_ticket\r\nfrom(select * from log_player_coin order by log_time desc) e\r\nwhere e.f1=1 group by log_user) d\r\nON c.log_user = d.log_user\r\n) f ON a.log_user = f.log_user','2014-11-20 14:13:31',0,'筛选时间范围内的有登录玩家的剩余钻石\r\n','{\"等级\":{\"name\":\"log_level\",\"dict\":\"\",\"sort\":true,\"multiple\":false,\"search\":false,\"merge_value\":false,\"single\":false,\"fixed\":false,\"order_num\":0}}','',''),(290,'statistic_result',0,'基本数据统计报表','日期,充值金额,充值钻石,充值次数,充值人数,登录用户数,新增注册,创建角色,次日留存,每天最高在线,每天平均在线,留存率,arpu值(钻石赠券),付费率,充值增长率,登录用户增减率,上月同比收入增减率','','','',0,'SELECT dd,pa,pg,pc,pn,lg,nc,cr,nl,om,oa,CONCAT(ROUND(nl/nc*100,2),\'%%\'),\r\nCONCAT(ROUND(pg/pn,2)),\r\nCONCAT(ROUND(pn/lg*100,2),\'%%\'),\r\nCONCAT(ROUND((pg-db_pg)/db_pg*100,2),\'%%\'),\r\nCONCAT(ROUND((lg-db_lg)/db_lg*100,2),\'%%\'),\r\nCONCAT(ROUND((pg-dm_pg)/dm_pg*100,2),\'%%\')\r\nFROM\r\n(\r\nSELECT DATE(r.log_time) as dd,\r\n    CONVERT(SUM(if(log_type=<<日充值>>,log_tag ,0)), SIGNED) pa, \r\n        CONVERT(SUM(if(log_type=<<日充值>>,log_now ,0)), SIGNED) pg, \r\n        CONVERT(SUM(if(log_type=<<日充值>>,log_result  ,0)), SIGNED) pn, \r\n        CONVERT(SUM(if(log_type=<<日充值>>,log_data  ,0)), SIGNED) pc, \r\n        CONVERT(SUM(if(log_type=<<日登录>>,log_now ,0)), SIGNED) lg, \r\n        CONVERT(SUM(if(log_type=<<时新增注册>>,log_now ,0)), SIGNED) nc, \r\n        CONVERT(SUM(if(log_type=<<日留存>> AND log_tag=1,log_now ,0)), SIGNED) nl,\r\n   CONVERT(SUM(if(log_type=<<时新增角色>>,log_now ,0)), SIGNED) cr, \r\n        CONVERT(MAX(if(log_type=<<时在线人数>>,CONVERT(log_now,SIGNED) ,0)), SIGNED) om, \r\n    CONVERT(AVG(if(log_type=<<时在线人数>>,CONVERT(log_now,SIGNED) ,NULL)), SIGNED) oa,\r\n      (SELECT SUM(log_now) FROM log_statistic_result WHERE log_type=<<日充值>> AND DATE(log_time)=DATE(ADDDATE(r.log_time,-1)) AND log_server IN ({{server_ids}}) AND log_channel IN({{channel_ids}}) ) db_pg,\r\n   (SELECT SUM(log_now) FROM log_statistic_result WHERE log_type=<<日登录>> AND DATE(log_time)=DATE(ADDDATE(r.log_time,-1)) AND log_server IN ({{server_ids}}) AND log_channel IN({{channel_ids}}) ) db_lg,\r\n        (SELECT SUM(log_now) FROM log_statistic_result WHERE log_type=<<时新增注册>> AND DATE(log_time)=DATE(ADDDATE(r.log_time,-1)) AND log_server IN ({{server_ids}}) AND log_channel IN({{channel_ids}})  ) db_cr,\r\n   (SELECT SUM(log_now) FROM log_statistic_result WHERE log_type=<<日充值>> AND DATE(log_time)=DATE(DATE_SUB(r.log_time,interval 1 MONTH)) AND log_server IN ({{server_ids}}) AND log_channel IN({{channel_ids}}) )dm_pg  \r\nFROM log_statistic_result r \r\nWHERE log_time>=\'{{sdate}}\' AND log_time<=\'{{edate}}\' AND log_server IN ({{server_ids}}) AND log_channel IN({{channel_ids}}) \r\nGROUP BY dd\r\n) c ','2014-11-20 14:52:26',0,'','{\"日期\":{\"name\":\"dd\",\"dict\":\"\",\"sort\":true,\"multiple\":false,\"search\":false,\"merge_value\":true,\"single\":false,\"fixed\":false,\"order_num\":99}}','',''),(306,'dict',0,'字典映射表','字典key,key,value','','游戏流水','',0,'SELECT log_name,log_previous,log_now\r\nFROM log_dict\r\nWHERE log_name=\'{{字典key}}\'','2014-12-01 10:35:15',0,'','{\"字典key\":{\"name\":\"log_name\",\"dict\":\"\",\"sort\":true,\"multiple\":false,\"search\":true,\"merge_value\":false,\"single\":false,\"fixed\":false,\"order_num\":0}}','',NULL),(326,'player',0,'玩家角色列表','-,角色ID,角色名称,等级,所属渠道,玩家类型,关联账号,登录数,手机标识,上次登录时间,登录IP,创建时间,玩家状态,滚服数,操作','','页面','',0,'select \'\',p.player_id,p.player_name,pp.log_level     level,p.channel_id,p.user_type,p.link_key,p.login_num,p.mobile_key,p.last_time,p.last_ip,p.create_time,p.status ,\r\nIFNULL(pr.roll_