INSERT INTO `statistic_new` VALUES (3,4,0,'时新增注册','','','SELECT  DATE_FORMAT(log_time,\'%Y-%m-%d %H:00:00\') AS dh,log_server,channel_id,0,\r\nCOUNT(0) ,\r\nCOUNT(DISTINCT mobile_key)\r\nFROM (select * from log_check_user c \r\nleft join \r\n(select player_id,channel_id,mobile_key from player_{{server_id}} ) p \r\non p.player_id = c.log_user\r\nWHERE log_data = 1  and log_server={{server_id}} \r\nAND log_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\') d\r\nGROUP BY dh,log_server,channel_id',0,'2019-01-31 11:30:55',1,0,'新增注册,当天点击屏幕进入游戏的数量\r\n时间点,服务器ID,渠道ID,标识值(登录角色),留存值\r\nlog_now 注册  不去重\r\nlog_previous 设备   去重','[2019-01-31 00:00:00 - 2019-01-31 23:59:59]:([-1L, 2L, 3L, 11L])'),(4,4,0,'时新增设备','','','SELECT  DATE_FORMAT(log_time,\'%Y-%m-%d %H:00:00\') AS dh,log_server,channel_id,0,COUNT(DISTINCT mobile_key) \r\nfrom (select log_time,log_server,p.mobile_key,p.channel_id from log_check_user c  \r\nleft join \r\n(select player_id,channel_id,mobile_key from player_{{server_id}} ) p \r\non p.player_id = c.log_user \r\nWHERE log_data = 1 and log_server= {{server_id}}\r\nAND log_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\' \r\n) a GROUP BY dh,log_server,channel_id',0,'2019-01-31 11:30:55',1,0,'新增设备,当天点击屏幕进入游戏的设备数量\r\n','[2019-01-31 00:00:00 - 2019-01-31 23:59:59]:([-1L, 2L, 3L, 11L])'),(5,109,0,'时新增角色','','','SELECT  DATE_FORMAT(create_time,\'%Y-%m-%d %H:00:00\') AS dh,player_id>>20 AS log_server,channel_id AS log_channel,0,\r\nCOUNT(IF(player_name<>\'\' AND player_name IS NOT NULL,1,NULL)),\r\nCOUNT(DISTINCT link_key) \r\nFROM player_{{server_id}} c\r\nWHERE create_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\' \r\nGROUP BY dh,log_server,log_channel',0,'2019-01-31 11:30:55',1,0,'新增角色,当天进入游戏并有创建角色名的数量\r\nlog_now 新增角色\r\nlog_previous 新增注册\r\n','[2019-01-31 00:00:00 - 2019-01-31 23:59:59]:([-1L, 2L, 3L, 11L])'),(6,4,0,'日登录用户--','','','SELECT  Date(log_time) AS dh,log_server,log_channel,\r\ncount(0),\r\nCOUNT(DISTINCT log_user) \r\nFROM log_check_user c\r\nWHERE log_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\' and log_server={{server_id}}\r\nGROUP BY dh,log_server,log_channel',0,NULL,0,0,'当天登录的用户数\r\n','[2016-06-05 00:00:00 - 2026-06-05 23:59:59]:([])'),(7,4,0,'时登录','','','SELECT  DATE_FORMAT(log_time,\'%Y-%m-%d %H:00:00\') dh,log_server,log_channel,0,COUNT(DISTINCT log_user),COUNT(0) \r\nFROM log_check_user c\r\nLEFT JOIN(select player_id,channel_id from player_{{server_id}}) e on e.player_id = c.log_user\r\nWHERE  log_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\' and log_server={{server_id}} \r\nGROUP BY log_channel,log_server,f4,dh',0,'2019-01-31 11:30:55',1,0,'统计当天时间段内 登录的次数\r\nlog_now 人数\r\nlog_previosu次数','[2019-01-31 00:00:00 - 2019-01-31 23:59:59]:([-1L, 2L, 3L, 11L])'),(8,4,0,'日老用户','','','SELECT  DATE_FORMAT(log_time,\'%Y-%m-%d 00:00:00\') AS dh,log_server,p.channel_id,\r\nCOUNT(0) as log_tag,\r\nCOUNT(DISTINCT log_user) \r\nFROM (select * from log_check_user c) a \r\nleft join(\r\nselect player_id,channel_id,mobile_key from player_{{server_id}} ) p \r\non p.player_id = a.log_user\r\nWHERE  log_user NOT IN ({{neibuhao}}) AND log_data>1 and log_server={{server_id}}\r\nAND log_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\' \r\nAND NOT EXISTS (\r\nSELECT log_user FROM log_check_user  c1 WHERE a.log_user=c1.log_user AND c1.log_data=1 AND DATE(c1.log_time)=DATE(a.log_time)\r\n)\r\nGROUP BY dh,log_server,p.channel_id',0,'2019-01-31 11:30:55',1,0,'log_tag 为登录次数没去重\r\n定义：今天登录的非新玩家,去掉今天log_data=1的新注册','[2019-01-31 00:00:00 - 2019-01-31 23:59:59]:([-1L, 2L, 3L, 11L])'),(9,4,0,'日登录','','','SELECT  DATE(log_time) AS dh,log_server,channel_id,0,COUNT(DISTINCT log_user) ,count(0),count(distinct link_key)\r\nFROM \r\n(select log_time,log_server,e.channel_id,log_user,link_key from log_check_user c\r\nleft join(\r\nselect player_id,channel_id,link_key from player_{{server_id}}) e on e.player_id = c.log_user\r\nWHERE log_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\' and log_server={{server_id}} \r\n) d\r\nGROUP BY dh,log_server,channel_id',0,'2019-01-31 11:30:55',1,0,'当天登录的用户数\r\nlog_now 人数\r\nlog_previous 次数\r\nlog_result 账号登陆数','[2019-01-31 00:00:00 - 2019-01-31 23:59:59]:([-1L, 2L, 3L, 11L])'),(10,4,0,'日角色总数','','','SELECT dd,log_server,log_channel,0 as log_tag,count(0)\r\nFROM \r\n\r\n(\r\nSELECT d.dd,p.create_time,{{server_id}} as log_server,other as log_channel \r\nFROM player_{{server_id}} p\r\n  JOIN\r\n  (\r\n   SELECT DATE_FORMAT(ld.log_time,\'%Y-%m-%d 00:00:00\') dd\r\n    FROM log_statistic_date ld  \r\n    WHERE ld.log_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\' AND date(NOW())>=date(\'{{edate}}\')\r\n    GROUP BY dd\r\n ) d \r\n  ON p.create_time<=d.dd\r\n  WHERE p.player_name<>\'\'\r\n) a\r\nGROUP BY dd,log_server,log_channel,log_tag\r\n',0,'2019-01-31 11:30:55',1,0,'日角色总数\r\n','[2019-01-31 00:00:00 - 2019-01-31 23:59:59]:([-1L, 2L, 3L, 11L])'),(11,109,0,'3日流失角色数','','','SELECT p.dd dd ,p.log_server,p.log_channel,COUNT(0) as log_tag,\r\nCOUNT(IF((SELECT log_time FROM log_check_user WHERE log_user=p.player_id AND log_server=p.log_server AND log_channel=p.log_channel \r\nAND log_time BETWEEN DATE(ADDDATE(dd,-3)) AND dd limit 1),null,1))\r\nFROM\r\n(\r\nSELECT d.dd as dd,p.create_time,{{server_id}} as log_server,other as log_channel ,p.player_id player_id \r\nFROM player_{{server_id}} p\r\n JOIN\r\n  (\r\n   SELECT DATE_FORMAT(ld.log_time,\'%Y-%m-%d 00:00:00\') dd \r\n   FROM log_statistic_date ld  \r\n    WHERE ld.log_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\' \r\n    GROUP BY dd\r\n ) d ON DATE(p.create_time)<=DATE(ADDDATE(dd,-3)) \r\n    WHERE p.player_name<>\'\'  \r\n) p \r\nGROUP BY dd,log_server,log_channel',0,'2019-01-31 11:30:55',1,0,'流失用户数=最近3天内没有登录游戏的角色数\r\n先找出角色创建时间<=时间点-3天的的列表,在log_check_use找时间点-3天到时间点有没登录过\r\nlog_tag为非3天内创建的角色数','[2019-01-31 00:00:00 - 2019-01-31 23:59:59]:([-1L, 2L, 3L, 11L])'),(12,117,0,'时在线人数','','','SELECT DATE_FORMAT(log_time,\'%Y-%m-%d %H:00:00\') dh,log_server,log_channel,0,MAX(round(f1,0)) om,round(AVG(round(f1,0)),0) oa\r\nFROM log_playing\r\nWHERE log_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\'  \r\nGROUP BY dh,log_server,log_channel',0,'2019-01-31 11:30:55',1,0,'时在线人数,\r\n最高log_now\r\n平均log_previous','[2019-01-31 00:00:00 - 2019-01-31 23:59:59]:([-1L, 2L, 3L, 11L])'),(16,4,0,'30日后留存','','','SELECT dd,log_server,f4,0,COUNT(log_user) \r\nFROM\r\n (\r\n  SELECT DATE(log_time) dd,f4,log_server,log_user,log_time AS log_time\r\n  FROM \r\n     log_check_user t1\r\n   WHERE \r\n    log_data=1 AND t1.log_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\' AND log_server=\'{{server_id}}\'\r\n   GROUP BY dd,f4,log_server,log_user\r\n ) tb1 \r\n WHERE EXISTS\r\n(\r\n SELECT 1 FROM log_check_user t2 WHERE t2.log_channel=tb1.log_channel AND t2.log_server=tb1.log_server AND t2.log_user=tb1.log_user\r\n  AND t2.log_time>=ADDDATE(tb1.dd,30)\r\n)\r\nGROUP BY dd,log_server,f4',0,'2019-01-31 01:01:37',1,31,'30日后留存\r\n','[2018-12-30 00:00:00 - 2019-01-30 23:59:59]:([-1L, 2L, 3L, 11L])'),(17,4,0,'连续2日登录','','','SELECT dd,log_server,f4,0,COUNT(log_user) \r\nFROM\r\n (\r\n SELECT DATE(log_time) dd,f4,log_server,log_user,log_time AS log_time\r\n  FROM \r\n     log_check_user t1\r\n   WHERE  t1.log_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\'   AND log_server=\'{{server_id}}\'\r\n   GROUP BY dd,f4,log_server,log_user\r\n ) tb1 \r\n WHERE EXISTS\r\n(\r\n SELECT 1 FROM log_check_user t2 WHERE t2.log_channel=tb1.log_channel AND t2.log_server=tb1.log_server AND t2.log_user=tb1.log_user\r\n  AND DATE(t2.log_time)=DATE(ADDDATE(tb1.dd,1))\r\n)\r\nGROUP BY dd,log_server,f4',0,'2019-01-31 01:01:37',1,2,'今天和明天都有登录\r\n','[2019-01-28 00:00:00 - 2019-01-30 23:59:59]:([-1L, 2L, 3L, 11L])'),(18,135,0,'日在线时长','','','SELECT dd,log_server,log_channel,log_tag,count(0)\r\nFROM\r\n(\r\nSELECT dd,log_server,log_channel,\r\nCASE \r\nWHEN o_n BETWEEN 0 AND 5*60 THEN 1\r\nWHEN o_n BETWEEN 5*60 AND 30*60 THEN 2\r\nWHEN o_n BETWEEN 30*60+1 AND 60*60 THEN 3\r\nWHEN o_n BETWEEN 60*60+1 AND 120*60 THEN 4\r\nWHEN o_n BETWEEN 120*60+1 AND 180*60 THEN 5\r\nWHEN o_n BETWEEN 180*60+1 AND 300*60 THEN 6\r\nWHEN o_n BETWEEN 300*60+1 AND 480*60 THEN 7\r\nWHEN o_n > 480*60+1 THEN 8\r\nEND as log_tag,\r\no_n\r\nFROM \r\n(\r\nSELECT lo.lg_time dd,lo.log_user,CONVERT(lo.o_n,SIGNED) o_n,d.channel_id as log_channel,{{server_id}} as log_server\r\nFROM\r\n(\r\n  SELECT log_user,SUM(f2-f1) as o_n ,DATE(FROM_UNIXTIME(f1)) as lg_time\r\n from {{master_db}}.log_player_online\r\n  WHERE DATE(FROM_UNIXTIME(f1)) BETWEEN \'{{sdate}}\' AND \'{{edate}}\'\r\n GROUP BY lg_time,log_user \r\n) lo JOIN player_{{server_id}} p\r\n  ON p.player_id=lo.log_user\r\n    left join (\r\nselect player_id,channel_id from player_{{server_id}}) d on lo.log_user = d.player_id\r\n    WHERE p.player_name<>\'\'  \r\n) a\r\n) b\r\nGROUP BY dd,log_server,log_channel,log_tag',0,'2019-01-31 11:30:55',1,0,'日在线时长, 活跃玩家数\r\nlog_tag \r\n           1          2                   3                    4              5             6                7                  8\r\n5分钟以内  5-30分钟  31-60分钟 1-2小时 2-3小时 3-5小时 5-8小时 8小时以上\r\n\r\n活跃玩家数定义：玩家当日登录时长超过30分钟(菲音180)\r\n','[2019-01-31 00:00:00 - 2019-01-31 23:59:59]:([-1L, 2L, 3L, 11L])'),(19,4,0,'日忠诚玩家数','','','SELECT dd,log_server,log_channel,0,count(log_user)\r\nFROM\r\n(\r\n  SELECT a.dd dd,count(DISTINCT b.dd) login_num,a.log_server log_server,a.channel_id log_channel,a.log_user,sum(o_n) o_n FROM  \r\n  ( \r\n  SELECT DATE(log_time) dd,channel_id,log_server,log_user    \r\n FROM log_check_user c\r\n LEFT JOIN(select player_id,channel_id from player_{{server_id}}) e on e.player_id = c.log_user\r\n    WHERE log_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\' AND  log_server=\'{{server_id}}\'\r\n    GROUP BY dd,log_channel,log_server,log_user  \r\n  ) a  \r\n  LEFT JOIN\r\n  ( \r\n   SELECT DATE(log_time) dd,SUM(f2-f1) o_n ,log_user FROM log_player_online t2 \r\n   WHERE log_time BETWEEN \'{{sdate}}\' AND ADDDATE(\'{{edate}}\',3)     \r\n   GROUP BY dd,log_user\r\n   ) b\r\n  ON a.log_user=b.log_user AND  b.dd BETWEEN a.dd AND ADDDATE(a.dd,2)\r\n  GROUP BY dd,a.log_user  HAVING o_n>180*60 AND login_num>=3\r\n) a\r\nGROUP BY dd,log_server,log_channel',0,'2019-01-31 11:30:55',1,0,'定义：连续三天都有登陆记录,且三天登陆在线时长总和大于等于3小时(菲音5小时)','[2019-01-31 00:00:00 - 2019-01-31 23:59:59]:([-1L, 2L, 3L, 11L])'),(20,4,0,'日留存','','','SELECT s_d,log_server,log_channel,liucun,COUNT(log_user)\r\nFROM \r\n(\r\n  SELECT a.dd s_d,b.dd e_d,DATEDIFF(b.dd,a.dd) as liucun,a.log_user,a.channel_id log_channel,{{server_id}} log_server\r\nFROM\r\n(\r\nSELECT DATE(log_time) dd,log_user,channel_id \r\nFROM log_check_user c \r\nLEFT JOIN(select player_id,channel_id from player_{{server_id}}) e on e.player_id = c.log_user\r\nWHERE log_data=1 AND log_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\' AND log_server={{server_id}}\r\nGROUP BY dd,log_user,channel_id\r\n)a\r\nJOIN\r\n(\r\n  SELECT DATE(log_time) dd,log_user,channel_id \r\nFROM log_check_user f\r\nLEFT JOIN(select player_id,channel_id from player_{{server_id}}) j on j.player_id = f.log_user\r\nWHERE log_data>1 AND log_time BETWEEN ADDDATE(\'{{sdate}}\',1) AND ADDDATE(\'{{edate}}\',31) AND log_server={{server_id}} \r\nGROUP BY dd,log_user,channel_id\r\n) b\r\nON a.log_user=b.log_user AND a.channel_id=b.channel_id AND b.dd>a.dd\r\n) d\r\nWHERE liucun<=30 AND  s_d<DATE(\'{{edate}}\')\r\nGROUP BY s_d,log_server,log_channel,liucun',0,'2019-01-31 01:01:37',1,31,'日留存\r\nlog_tag 1为次日留存 2为2日留存 7为7日留存以此类推\r\n\r\n最大到30日留存','[2018-12-30 00:00:00 - 2019-01-30 23:59:59]:([-1L, 2L, 3L, 11L])'),(21,135,0,'日等级在线时长','','','SELECT dd,log_server,log_channel,log_tag,COUNT(log_user),lv \r\nFROM \r\n(\r\nSELECT dd,log_server,log_channel,log_tag,MAX(lv) lv,log_user FROM\r\n (\r\n     SELECT a.dd,a.log_server,a.log_channel,\r\n     CASE \r\n     WHEN o_n BETWEEN 0 AND 5*60 THEN 1\r\n      WHEN o_n BETWEEN 5*60 AND 30*60 THEN 2\r\n      WHEN o_n BETWEEN 30*60+1 AND 60*60 THEN 3\r\n     WHEN o_n BETWEEN 60*60+1 AND 120*60 THEN 4\r\n      WHEN o_n BETWEEN 120*60+1 AND 180*60 THEN 5\r\n     WHEN o_n BETWEEN 180*60+1 AND 300*60 THEN 6\r\n     WHEN o_n BETWEEN 300*60+1 AND 480*60 THEN 7\r\n     WHEN o_n > 480*60+1 THEN 8\r\n      END as log_tag,\r\n     a.o_n,\r\n      a.level lv,\r\n     a.log_user\r\n      FROM \r\n     (\r\n     SELECT lo.lg_time dd,lo.log_user,CONVERT(lo.o_n,SIGNED) o_n,p.channel_id as log_channel,{{server_id}} as log_server,lo.level\r\n      FROM\r\n      (\r\n         SELECT log_user,SUM(f2-f1) as o_n ,DATE(FROM_UNIXTIME(f1)) as lg_time,max(log_level) as level\r\n         from {{master_db}}.log_player_online\r\n          WHERE DATE(FROM_UNIXTIME(f1)) BETWEEN \'{{sdate}}\' AND \'{{edate}}\'\r\n           AND log_user NOT IN ({{neibuhao}})\r\n          GROUP BY lg_time,log_user\r\n     ) lo JOIN player_{{server_id}} p ON p.player_id=lo.log_user\r\n     WHERE  p.player_name<>\'\' \r\n    ) a         \r\n ) b\r\n GROUP BY log_user\r\n) c\r\nGROUP  BY dd,log_server,log_channel,log_tag,lv',0,'2019-01-31 11:30:55',1,0,'日在线时长, 活跃玩家数\r\nlog_tag \r\n           1          2                   3                    4              5             6                7                  8\r\n5分钟以内 5-30分钟  31-60分钟 1-2小时 2-3小时 3-5小时 5-8小时 8小时以上\r\nlog_log_previous 为等级\r\n活跃玩家数定义：玩家当日登录时长超过30分钟(菲音180)\r\n','[2019-01-31 00:00:00 - 2019-01-31 23:59:59]:([-1L, 2L, 3L, 11L])'),(22,1,0,'日新增激活','','','select DATE(a.log_time) dd,a.log_server,a.log_channel,0,count(distinct f1) \r\nfrom log_open a \r\nwhere a.log_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\'\r\nAND NOT EXISTS (select 0 from log_open b where b.f1=a.f1 and b.log_time<a.log_time) \r\ngroup by dd,a.log_server,a.log_channel\r\n',0,'2019-01-31 11:30:55',1,0,'                log.f1 = request.POST.get(\'imei\',\'\')\r\n                log.f3 = request.POST.get(\'dec\',\'\')\r\n                log.f2 = request.POST.get(\'ver\',\'\')\r\n                log.f4 = mobile_info\r\n                log.f6 = request.POST.get(\'other\',\'\')','[2019-01-31 00:00:00 - 2019-01-31 23:59:59]'),(23,97,0,'日充值','','','SELECT DATE(pa.post_time) AS dd,\r\n pa.server_id AS log_server,\r\n pa.channel_id AS log_channel,\r\n 0,\r\n  SUM(pa.pay_gold),\r\n SUM(pa.post_amount),\r\n  COUNT(DISTINCT pay_user),\r\n COUNT(pa.id)\r\n  \r\nFROM\r\n  pay_action pa\r\nWHERE \r\n pa.pay_status=4\r\n AND pa.pay_amount != 0\r\n  AND pa.post_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\'\r\nGROUP BY dd,log_server,log_channel ',0,'2019-01-31 11:30:55',1,0,'log_now金币\r\nlog_previous金额\r\nlog_result人数\r\nlog_data  次数\r\n','[2019-01-31 00:00:00 - 2019-01-31 23:59:59]'),(24,97,0,'日充值数','','','SELECT DATE(pa.post_time) AS dd,\r\n pa.server_id AS log_server,\r\n pa.channel_id AS log_channel,\r\n 0,\r\n  COUNT(DISTINCT pa.pay_user),\r\n  COUNT(pa.id)\r\n  \r\nFROM\r\n  pay_action pa\r\nWHERE \r\n pa.pay_status=4\r\n AND pa.pay_amount != 0\r\n  AND pa.post_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\'\r\nGROUP BY dd,log_server,log_channel ',0,'2019-01-31 11:30:55',1,0,'log_previous 充值次数\r\nlog_now 充值人数','[2019-01-31 00:00:00 - 2019-01-31 23:59:59]'),(25,102,0,'日银币收支','','','SELECT s.dd dd,{{server_id}} log_server,p.channel_id log_channel,s.log_type log_tag,SUM(s.expend),SUM(s.acquire)\r\nFROM\r\n (\r\n   SELECT DATE(log_time) dd,log_user,log_type,\r\n   sum(if(log_now-log_previous<0 ,log_now-log_previous,0)) expend,\r\n   sum(if(log_now-log_previous>0 ,log_now-log_previous,0))  acquire \r\n   FROM {{master_db}}.log_silver   s\r\n   WHERE log_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\' AND log_user>>20={{server_id}}\r\n   AND log_user NOT IN ({{neibuhao}})\r\n    GROUP BY dd,log_user,log_type\r\n ) s  JOIN player_{{server_id}} p ON p.player_id=s.log_user\r\nGROUP BY dd,log_server,log_channel ,log_tag\r\n',0,NULL,0,0,'log_tag 项目\r\nlog_now今日产出  \r\nlog_previous 今日消耗\r\n','[2016-12-23 00:00:00 - 2016-12-23 23:59:59]:([])'),(26,7,0,'日金币收支','','','SELECT s.dd dd,{{server_id}} log_server,p.channel_id log_channel,s.log_type log_tag,SUM(s.expend),SUM(s.acquire)\r\nFROM\r\n  (\r\n   SELECT DATE(log_time) dd,log_user,log_type,\r\n   sum(if(log_now-log_previous<0 ,log_now-log_previous,0)) expend,\r\n   sum(if(log_now-log_previous>0 ,log_now-log_previous,0))  acquire \r\n   FROM {{master_db}}.log_gold   s\r\n   WHERE log_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\' AND log_user>>20={{server_id}}\r\n   AND log_user NOT IN ({{neibuhao}})\r\n    GROUP BY dd,log_user,log_type\r\n ) s  JOIN player_{{server_id}} p ON p.player_id=s.log_user\r\nGROUP BY dd,log_server,log_channel,log_tag\r\n',0,NULL,0,0,'log_tag 项目\r\nlog_now今日产出 \r\nlog_previous 今日消耗\r\n','[2016-12-23 00:00:00 - 2016-12-23 23:59:59]:([])'),(27,7,0,'日金币剩余','','',' SELECT a.dd,{{server_id}} log_server,a.log_channel log_channel,0 log_tag,SUM(s.log_now)\r\nFROM \r\n(\r\n  SELECT ld.dd ,sd.dd sd,sd.log_user,MAX(sd.mid) mid,p.channel_id log_channel\r\n FROM \r\n (\r\n     SELECT date(log_time)dd,log_user,MAX(id) AS mid FROM log_gold \r\n          WHERE log_time<=\'{{edate}}\' AND log_user NOT IN ({{neibuhao}}) AND log_user>>20={{server_id}}\r\n         GROUP BY dd,log_user\r\n  ) sd\r\n  JOIN (\r\n    SELECT DATE(log_time) dd FROM\r\n   log_statistic_date ld\r\n   WHERE log_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\'\r\n    GROUP BY dd\r\n ) ld\r\n  ON ld.dd>=sd.dd\r\n JOIN player_{{server_id}} p ON p.player_id=sd.log_user\r\n  GROUP BY ld.dd,log_channel,sd.log_user\r\n) a \r\nJOIN log_gold s\r\nON a.log_user=s.log_user AND s.id=a.mid\r\nGROUP BY a.dd,a.log_channel',0,NULL,0,0,'#思路 表sd(角色每日最大的流水ID),连ld(日期表),汇总出每个日前的最大流水ID','[2016-12-23 00:00:00 - 2016-12-23 23:59:59]:([])'),(28,102,0,'日银币剩余','','',' SELECT a.dd,{{server_id}} log_server,a.log_channel log_channel,0 log_tag,SUM(s.log_now)\r\nFROM \r\n(\r\n  SELECT ld.dd ,sd.dd sd,sd.log_user,MAX(sd.mid) mid,p.channel_id log_channel\r\n FROM \r\n (\r\n     SELECT date(log_time)dd,log_user,MAX(id) AS mid FROM log_silver \r\n          WHERE log_time<=\'{{edate}}\' AND log_user NOT IN ({{neibuhao}}) AND log_user>>20={{server_id}}\r\n         GROUP BY dd,log_user\r\n  ) sd\r\n  JOIN (\r\n    SELECT DATE(log_time) dd FROM\r\n   log_statistic_date ld\r\n   WHERE log_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\'\r\n    GROUP BY dd\r\n ) ld\r\n  ON ld.dd>=sd.dd\r\n JOIN player_{{server_id}} p ON p.player_id=sd.log_user\r\n  GROUP BY ld.dd,log_channel,sd.log_user\r\n) a \r\nJOIN log_silver s\r\nON a.log_user=s.log_user AND s.id=a.mid\r\nGROUP BY a.dd,a.log_channel',0,NULL,0,0,'#思路 表sd(角色每日最大的流水ID),连ld(日期表),汇总出每个日前的最大流水ID','[2016-12-23 00:00:00 - 2016-12-23 23:59:59]:([])'),(30,4,0,'日新增设备','','','SELECT date(a.last_time) dd,a.log_server server_id,a.f4 channel_id,0 log_tag,COUNT(0)\r\nFROM\r\n(\r\nSELECT MIN(log_time) last_time,log_server,f4,f3\r\nFROM log_check_user WHERE log_data=1\r\nGROUP BY f3\r\n)a\r\nWHERE a.last_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\' \r\nGROUP BY dd,server_id,channel_id,log_tag\r\n',0,'2019-01-31 11:30:55',1,0,'按设备唯一标识去重\r\n','[2019-01-31 00:00:00 - 2019-01-31 23:59:59]:([-1L, 2L, 3L, 11L])'),(31,109,0,'周新增角色','','','SELECT week_first_day,log_server,log_channel,0,role_num,zhuce_num\r\nFROM\r\n(\r\n  SELECT  DATE_ADD(DATE(create_time),INTERVAL -WEEKDAY(create_time) DAY) week_first_day,\r\n  player_id>>20 AS log_server,channel_id AS log_channel,\r\n  COUNT(player_id) role_num,\r\n  COUNT(0) zhuce_num\r\n  FROM player_{{server_id}} c\r\n  WHERE  create_time BETWEEN DATE(\'{{sdate}}\') AND ADDDATE(DATE(\'{{edate}}\'),7)\r\n  GROUP BY week_first_day,log_server,log_channel\r\n) a\r\nWHERE week_first_day>=DATE(\'{{sdate}}\') AND week_first_day<=DATE(\'{{edate}}\')\r\n',0,'2019-01-31 01:01:37',1,7,'新增角色,当周进入游戏并有创建角色名的数量\r\nlog_now 新增角色\r\nlog_previous 新增注册\r\n','[2019-01-23 00:00:00 - 2019-01-30 23:59:59]:([-1L, 2L, 3L, 11L])'),(32,4,0,'周留存','','','SELECT a_week_first_day,log_server,channel,liucun,COUNT(0),0\r\nFROM\r\n(\r\n   SELECT DATEDIFF(b.week_first_day,a.week_first_day)/7 AS liucun,a.log_user,a.channel_id channel,{{server_id}} log_server ,\r\n  a.week_first_day a_week_first_day,b.week_first_day b_week_first_day,a.log_data\r\n  FROM\r\n  (\r\n   SELECT log_user,channel_id ,DATE_ADD(DATE(log_time),INTERVAL -WEEKDAY(log_time) DAY) week_first_day,log_data\r\n    FROM log_check_user c \r\n    LEFT JOIN(select player_id,channel_id from player_{{server_id}}) e on e.player_id = c.log_user\r\n    WHERE log_data=1 AND log_time BETWEEN DATE(\'{{sdate}}\') AND ADDDATE(DATE(\'{{edate}}\'),7) AND log_server={{server_id}}\r\n    GROUP BY week_first_day,log_user,channel_id \r\n )a\r\n  JOIN\r\n  (\r\n   SELECT log_user,channel_id , DATE_ADD(DATE(log_time),INTERVAL -WEEKDAY(log_time) DAY) week_first_day\r\n    FROM log_check_user c\r\n   LEFT JOIN(select player_id,channel_id from player_{{server_id}}) e on e.player_id = c.log_user\r\n    WHERE log_data>1 AND log_time BETWEEN ADDDATE(DATE(\'{{sdate}}\'),6) AND ADDDATE(DATE(\'{{edate}}\'),50) AND log_server={{server_id}}\r\n   GROUP BY week_first_day,log_user,channel_id\r\n ) b\r\n ON a.log_user=b.log_user AND a.channel_id=b.channel_id AND b.week_first_day>a.week_first_day\r\n)d\r\nWHERE liucun<=5 AND a_week_first_day>=DATE(\'{{sdate}}\') AND a_week_first_day<=DATE(\'{{edate}}\')\r\nGROUP BY a_week_first_day,log_server,channel,liucun',0,'2019-01-31 01:01:37',1,60,'周留存\r\nlog_tag 1为次周留存 2为2周留存以此类推\r\n最大到5周留存\r\n星期1为一周开始','[2018-12-01 00:00:00 - 2019-01-30 23:59:59]:([-1L, 2L, 3L, 11L])'),(33,4,0,'月留存','','','SELECT s_mon, log_server, channel_id, liucun, COUNT(log_user) ,0\r\nFROM (\r\n  SELECT a.mon AS s_mon, b.mon AS e_mon, FLOOR(DATEDIFF(b.mon, a.mon)/28) AS liucun, a.log_user, a.channel_id, {{server_id}} AS log_server  \r\n    FROM (\r\n    SELECT DATE_ADD(DATE(log_time),INTERVAL 1-DAY(log_time) DAY) mon, log_user, channel_id\r\n    FROM log_check_user c\r\n   LEFT JOIN(select player_id,channel_id from player_{{server_id}}) e on e.player_id = c.log_user\r\n    WHERE log_data=1 AND log_time BETWEEN DATE(\'{{sdate}}\') AND DATE_ADD(\'{{edate}}\',INTERVAL 1 MONTH) AND log_server={{server_id}}\r\n   GROUP BY mon, log_user, channel_id\r\n  ) a \r\n    JOIN (\r\n    SELECT DATE_ADD(DATE(log_time),INTERVAL 1-DAY(log_time) DAY) mon, log_user, channel_id\r\n    FROM log_check_user f\r\n   LEFT JOIN(select player_id,channel_id from player_{{server_id}}) j on j.player_id = f.log_user\r\n    WHERE log_data>1 AND log_time \r\n    BETWEEN DATE_ADD(\'{{sdate}}\',INTERVAL 1 MONTH) AND DATE_ADD(\'{{edate}}\',INTERVAL 6 MONTH) AND log_server={{server_id}}\r\n    GROUP BY mon, log_user, channel_id\r\n  ) b ON a.log_user=b.log_user AND a.channel_id = b.channel_id AND b.mon>a.mon\r\n) d\r\nWHERE liucun<6 AND s_mon>=DATE(\'{{sdate}}\') AND s_mon<=DATE(\'{{edate}}\')\r\nGROUP BY s_mon, channel_id, liucun',0,'2019-01-31 01:01:37',1,183,'月留存\r\nlog_tag 1为次月留存 2为2月留存以此类推\r\n最大到5月留存\r\n统计时间跨度不能太大','[2018-07-31 00:00:00 - 2019-01-30 23:59:59]:([-1L, 2L, 3L, 11L])'),(34,7,0,'7日LTV','','','SELECT t.dd, t.log_server,t.log_channel,COUNT(DISTINCT t.log_user) create_num,SUM(t.pay_gold) tol_pay_gold,SUM(pay_count) pay_count\r\nFROM\r\n(\r\n  SELECT DATE(c.log_time) dd,c.log_server log_server,c.log_user log_user,c.log_channel log_channel,\r\n  g.pay_gold pay_gold,g.pay_count pay_count\r\n  FROM log_check_user c\r\n LEFT JOIN \r\n  (\r\n   SELECT DATE(log_time) pay_time,CONVERT(SUM(f4-f3),SIGNED) pay_gold,COUNT(0) pay_count ,log_user \r\n    FROM {{master_db}}.log_gold WHERE log_type=1121  AND f4-f3>0\r\n    AND log_time BETWEEN \'{{sdate}}\' AND ADDDATE(\'{{edate}}\',7)\r\n   GROUP BY pay_time,log_user \r\n\r\n ) g ON c.log_user = g.log_user AND DATEDIFF(g.pay_time,c.log_time)<=7\r\n WHERE c.log_data=1  AND c.log_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\'\r\n) t\r\nGROUP BY t.dd,t.log_server,t.log_channel  \r\n',0,NULL,0,7,'新增玩家 7天内带来的充值数\r\nlog_tag 新增玩家数\r\nlog_now 充值砖石\r\nlog_previous 充值次数\r\n某日起M天内共新注册X人，他们在第M天的LTV值，即这N个人在这M天中的总充值额/X。（几天一起算）','[2016-12-22 00:00:00 - 2016-12-22 23:59:59]:([])'),(35,7,0,'14日LTV','','','SELECT t.dd, t.log_server,t.log_channel,COUNT(DISTINCT t.log_user) create_num,SUM(t.pay_gold) tol_pay_gold,SUM(pay_count) pay_count\r\nFROM\r\n(\r\n SELECT DATE(c.log_time) dd,c.log_ser