P BY dd,log_user HAVING o_n>60*30\r\n  ) lo JOIN player_{{server_id}} p\r\n   ON p.player_id=lo.log_user\r\n    WHERE p.player_name<>\'\' \r\n) b\r\nGROUP BY dd,log_server,log_channel,log_tag\r\n',0,'2019-01-31 01:01:37',1,3,'--近30日活跃角色：当日倒推30日（含当日）的日活跃角色数之和，按player ID去重\r\n','[2019-01-27 00:00:00 - 2019-01-30 23:59:59]:([-1L, 2L, 3L, 11L])'),(48,109,0,'用户数统计','','','SELECT c_mon,{{server_id}},channel_id,create_num,keep_num,\r\n(SELECT COUNT(0) FROM player_{{server_id}} WHERE create_time<b.mon_day AND last_time>=b.mon_day AND channel_id=channel_id) old_num,\r\n(SELECT COUNT(0) FROM player_{{server_id}} WHERE create_time<b.mon_day AND last_time>=b.next_mon_day AND channel_id=channel_id) old_keep_num,\r\n(SELECT COUNT(0) FROM player_{{server_id}} WHERE create_time<b.next_mon_day AND last_time>=b.mon_day AND channel_id=channel_id) login_num\r\nFROM\r\n(\r\n  SELECT c_mon,channel_id,\r\n  c_mon mon_day,\r\n  DATE_ADD(c_mon,INTERVAL 1 MONTH) next_mon_day,\r\n  COUNT(player_id) create_num,\r\n  COUNT(IF(l_mon>c_mon,1,NULL)) keep_num\r\n  FROM \r\n (\r\n     SELECT player_id,channel_id,DATE_FORMAT(create_time,\'%Y-%m-01\') c_mon,DATE_FORMAT(last_time,\'%Y-%m-01\') l_mon\r\n     FROM player_{{server_id}} \r\n  ) a\r\n GROUP BY c_mon,channel_id\r\n) b\r\nWHERE b.mon_day>=DATE(\'{{sdate}}\') AND b.mon_day<=DATE(\'{{edate}}\')',0,NULL,0,3000,'用户数统计\r\n这个统计是全部月份所以开始时间必须无限小\r\nlog_tag  月创建角色\r\nlog_now 新增月留存\r\nlog_previous 老角色\r\nlog_result 老角色留存\r\nlog_data 月登录角色',''),(49,109,0,'用户数统计留存','','','SELECT * \r\nFROM\r\n(SELECT\r\nDATE(create_time) dd,\r\n{{server_id}},\r\nchannel_id,\r\nCOUNT(IF(datediff(last_time,create_time)>=1,1,null)),\r\nCOUNT(IF(datediff(last_time,create_time)>=3,1,null)),\r\nCOUNT(IF(datediff(last_time,create_time)>=7,1,null)),\r\nCOUNT(IF(datediff(last_time,create_time)>=14,1,null)),\r\nCOUNT(IF(datediff(last_time,create_time)>=30,1,null))\r\nFROM  player_{{server_id}}\r\nWHERE create_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\'\r\nGROUP BY dd,channel_id\r\n) t\r\nWHERE t.dd>=date(\'{{sdate}}\') AND t.dd<=date(\'{{edate}}\')\r\n',0,NULL,0,3000,'用户估算法 求留存\r\nlog_tag 次日留存\r\nlog_now 3日留存\r\nlog_previous 7日留存\r\nlog_result  14日留存\r\nlog_data 30日留存\r\n','[2016-06-05 00:00:00 - 2026-06-05 23:59:59]:([])'),(50,97,0,'月充值','','','SELECT * \r\nFROM \r\n(SELECT DATE_ADD(DATE(pa.post_time),INTERVAL -dayofmonth(pa.post_time)+1 DAY) the_mon_first_day,\r\n  pa.server_id AS log_server,\r\n pa.channel_id AS log_channel,\r\n 0,\r\n  SUM(pay_gold),\r\n  SUM(pay_amount),\r\n  COUNT(DISTINCT pa.pay_user),\r\n  COUNT(pa.id)\r\n  \r\nFROM\r\n  pay_action pa\r\nWHERE \r\n pa.pay_status=4\r\n AND pa.pay_amount != 0\r\n  AND pa.post_time BETWEEN \'{{sdate}}\' AND  ADDDATE(DATE(\'{{edate}}\'),31)\r\nGROUP BY the_mon_first_day,log_server,log_channel \r\n) t\r\nWHERE  t.the_mon_first_day>=\'{{sdate}}\' AND t.the_mon_first_day<=\'{{edate}}\'',0,'2019-01-31 01:01:37',1,31,'log_now金币\r\nlog_previous金额\r\nlog_result人数 \r\nlog_data  次数\r\n','[2018-12-30 00:00:00 - 2019-01-30 23:59:59]'),(51,97,0,'周充值','','','SELECT * \r\nFROM \r\n(SELECT DATE_ADD(DATE(pa.post_time),INTERVAL -WEEKDAY(pa.post_time) DAY) week_first_day,\r\n pa.server_id AS log_server,\r\n pa.channel_id AS log_channel,\r\n 0,\r\n  SUM(pay_gold),\r\n  SUM(pay_amount),\r\n  COUNT(DISTINCT pa.pay_user),\r\n  COUNT(pa.id)\r\n  \r\nFROM\r\n  pay_action pa\r\nWHERE \r\n pa.pay_status=4\r\n AND pa.pay_amount != 0\r\n  AND pa.post_time BETWEEN \'{{sdate}}\' AND  ADDDATE(DATE(\'{{edate}}\'),7)\r\nGROUP BY week_first_day,log_server,log_channel \r\n) t\r\nWHERE  t.week_first_day>=\'{{sdate}}\' AND t.week_first_day<=\'{{edate}}\'',0,'2019-01-31 01:01:37',1,7,'log_now金币\r\nlog_previous金额\r\nlog_result人数\r\nlog_data  次数','[2019-01-23 00:00:00 - 2019-01-30 23:59:59]'),(52,109,0,'月新增角色','','','SELECT the_mon_first_day,log_server,log_channel,0,role_num,zhuce_num\r\nFROM\r\n(\r\n  SELECT  DATE_FORMAT(create_time,\'%Y-%m-01 00:00:00\') the_mon_first_day,\r\n  player_id>>20 AS log_server,channel_id AS log_channel,\r\n  COUNT(IF(player_name<>\'\' AND player_name IS NOT NULL,1,NULL)) role_num,\r\n  COUNT(0) zhuce_num\r\n  FROM player_{{server_id}} c\r\n  WHERE  create_time BETWEEN DATE(\'{{sdate}}\') AND ADDDATE(DATE(\'{{edate}}\'),31)\r\n  GROUP BY the_mon_first_day,log_server,log_channel\r\n) a\r\nWHERE the_mon_first_day>=DATE(\'{{sdate}}\') AND the_mon_first_day<=DATE(\'{{edate}}\')\r\n',0,'2019-01-31 01:01:37',1,31,'新增角色,当月进入游戏并有创建角色名的数量\r\nlog_now 新增角色\r\nlog_previous 新增注册\r\n','[2018-12-30 00:00:00 - 2019-01-30 23:59:59]:([-1L, 2L, 3L, 11L])'),(53,7,0,'1日LTV','','','SELECT t.dd, t.log_server,t.log_channel,COUNT(DISTINCT t.log_user) create_num,SUM(t.pay_gold) tol_pay_gold,SUM(pay_count) pay_count\r\nFROM\r\n(\r\n  SELECT DATE(c.log_time) dd,c.log_server log_server,c.log_user log_user,c.log_channel log_channel,\r\n  g.pay_gold pay_gold,g.pay_count pay_count\r\n  FROM log_check_user c\r\n LEFT JOIN \r\n  (\r\n   SELECT DATE(log_time) pay_time,CONVERT(SUM(f4-f3),SIGNED) pay_gold,COUNT(0) pay_count ,log_user \r\n    FROM {{master_db}}.log_gold WHERE log_type=1121  AND f4-f3>0\r\n    AND log_time BETWEEN \'{{sdate}}\' AND ADDDATE(\'{{edate}}\',1)\r\n   GROUP BY pay_time,log_user \r\n\r\n ) g ON c.log_user = g.log_user AND DATEDIFF(g.pay_time,c.log_time)<=1\r\n WHERE c.log_data=1  AND c.log_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\'\r\n) t\r\nGROUP BY t.dd,t.log_server,t.log_channel  ',0,NULL,0,1,'新增玩家 1天内带来的充值数\r\nlog_tag 新增玩家数\r\nlog_now 充值砖石\r\nlog_previous 充值次数\r\n某日起M天内共新注册X人，他们在第M天的LTV值，即这N个人在这M天中的总充值额/X。（几天一起算）','[2016-12-22 00:00:00 - 2016-12-22 23:59:59]:([])'),(54,7,0,'3日LTV','','','SELECT t.dd, t.log_server,t.log_channel,COUNT(DISTINCT t.log_user) create_num,SUM(t.pay_gold) tol_pay_gold,SUM(pay_count) pay_count\r\nFROM\r\n(\r\n  SELECT DATE(c.log_time) dd,c.log_server log_server,c.log_user log_user,c.log_channel log_channel,\r\n  g.pay_gold pay_gold,g.pay_count pay_count\r\n  FROM log_check_user c\r\n LEFT JOIN \r\n  (\r\n   SELECT DATE(log_time) pay_time,CONVERT(SUM(f4-f3),SIGNED) pay_gold,COUNT(0) pay_count ,log_user \r\n    FROM {{master_db}}.log_gold WHERE log_type=1121  AND f4-f3>0\r\n    AND log_time BETWEEN \'{{sdate}}\' AND ADDDATE(\'{{edate}}\',3)\r\n   GROUP BY pay_time,log_user \r\n\r\n ) g ON c.log_user = g.log_user AND DATEDIFF(g.pay_time,c.log_time)<=3\r\n WHERE c.log_data=1  AND c.log_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\'\r\n) t\r\nGROUP BY t.dd,t.log_server,t.log_channel  ',0,NULL,0,3,'新增玩家 3天内带来的充值数\r\nlog_tag 新增玩家数\r\nlog_now 充值砖石\r\nlog_previous 充值次数\r\n某日起M天内共新注册X人，他们在第M天的LTV值，即这N个人在这M天中的总充值额/X。（几天一起算）','[2016-12-22 00:00:00 - 2016-12-22 23:59:59]:([])'),(55,7,0,'日LTV','','','SELECT s_d,log_server,log_channel,ltv,\r\nSUM(pay_gold) tol_pay_gold,COUNT(DISTINCT log_user) create_num,SUM(pay_count) pay_count\r\nFROM \r\n(\r\n  SELECT a.dd s_d,b.dd e_d,DATEDIFF(b.dd,a.dd) as ltv,a.log_user,a.channel_id log_channel,{{server_id}} log_server,b.pay_gold pay_gold,b.pay_count pay_count\r\nFROM\r\n(\r\nSELECT DATE(log_time) dd,log_user,channel_id \r\nFROM log_check_user c \r\n  left join(\r\nselect player_id,channel_id from player_{{server_id}}) e on e.player_id = c.log_user\r\nWHERE log_data=1 AND log_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\' AND log_server={{server_id}}\r\nGROUP BY dd,log_user,channel_id\r\n)a\r\nLEFT JOIN\r\n(\r\n     SELECT DATE(log_time) dd,CONVERT(SUM(f2),SIGNED) pay_gold,COUNT(0) pay_count ,log_user\r\n    FROM {{master_db}}.log_player_recharge  WHERE log_time BETWEEN \'{{sdate}}\' AND ADDDATE(\'{{edate}}\',90)\r\n    GROUP BY dd,log_user \r\n) b\r\nON a.log_user=b.log_user AND b.dd>=a.dd\r\n) d\r\nWHERE ltv<=90 AND  s_d<DATE(\'{{edate}}\')\r\nGROUP BY s_d,log_server,log_channel,ltv',0,'2019-01-31 01:01:37',1,60,'新增玩家 x天内带来的充值数\r\nlog_tag LTV日期数,0今天,1 1天后\r\nlog_now 充值砖石\r\nlog_previous 创建人数\r\nlog_result 充值人数\r\n某日起M天内共新注册X人，他们在第M天的LTV值，即这N个人在这M天中的总充值额/X。（几天一起算）','[2018-12-01 00:00:00 - 2019-01-30 23:59:59]:([-1L, 2L, 3L, 11L])'),(58,7,0,'新旧付款玩家','','','select  b.log_time,log_server,log_channel,0,\r\nSUM(CASE WHEN x = 0 THEN 1 ELSE 0 END) new_user, \r\nSUM(CASE WHEN x = 1 THEN 1 ELSE 0 END) old_user,\r\nSUM(CASE WHEN x = 0 THEN b.pay_mount ELSE 0 END) new_amount,\r\nSUM(CASE WHEN x = 1 THEN b.pay_mount ELSE 0 END) old_amount\r\nfrom (\r\n select log_time,log_server,log_channel,pay_mount,x\r\n  from(  \r\n   select date(gd.log_time) log_time,gd.log_server,(gd.f4-gd.f3)/10 pay_mount,gd.log_user,\r\n   (select channel_id from player_{{server_id}} where player_id=gd.log_user) log_channel,\r\n    if((select id from player_{{server_id}} where player_id=gd.log_user and date(create_time) = date(gd.log_time) limit 1), 0, 1) x\r\n   from log_gold gd\r\n    where gd.log_type = 1121 and gd.log_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\'  and gd.f4-gd.f3 > 0\r\n ) a group by log_user,log_time,log_server,log_channel\r\n) b group by b.log_time,log_server,log_channel',0,NULL,0,0,'log_now             新付费人数:当天新增注册的充值用户\r\nlog_privious       旧付费人数:选定时间内，截止到某天之前注册的用户在今天充值的人数\r\nlog_log_result   新付费金额\r\nlog_data            旧付费金额','[2016-11-11 00:00:00 - 2016-11-11 23:59:59]:([])'),(60,4,0,'5分钟新增注册','','','SELECT  concat( date_format( log_time, \'%Y-%m-%d %H:\' ) , floor( date_format( log_time, \'%i\' ) /5 ) * 5 ) AS dh,log_server,log_channel,0,\r\nCOUNT(0) ,\r\nCOUNT(DISTINCT f3) ,\r\nSUM(b.pay_gold/10)\r\nFROM log_check_user c\r\nLEFT JOIN\r\n(\r\nSELECT CONVERT(SUM(f4-f3),SIGNED) pay_gold,log_user \r\nFROM log_gold WHERE log_type=1121  AND f4-f3>0\r\nAND log_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\'\r\nGROUP BY log_user\r\n) b ON c.log_user=b.log_user\r\nWHERE log_data = 1  and log_server={{server_id}} \r\nAND log_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\'\r\nGROUP BY dh',0,NULL,0,0,'新增注册,当天点击屏幕进入游戏的数量\r\n时间点,服务器ID,渠道ID,标识值(登录角色),留存值\r\nlog_now 注册\r\nlog_previous 设备',''),(61,109,0,'时新增去重注册','','','SELECT  DATE_FORMAT(create_time,\'%Y-%m-%d %H:00:00\') AS dh,player_id>>20 AS log_server,channel_id AS log_channel,0,\r\nCOUNT(IF(player_name<>\'\' AND player_name IS NOT NULL,1,NULL)),\r\nCOUNT(DISTINCT IFNULL(mobile_key,0))\r\nFROM player_{{server_id}} c\r\nWHERE create_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\' AND c.mobile_key <>\"\"\r\nGROUP BY dh,log_server,log_channel\r\n',0,'2019-01-31 11:30:55',1,0,'去重设备的注册数。即一个设备注册两个账号只算一个账号.','[2019-01-31 00:00:00 - 2019-01-31 23:59:59]:([-1L, 2L, 3L, 11L])'),(64,97,0,'时充值','','','SELECT date_format(pa.post_time,\"%Y-%m-%d %H:00:00\") AS dd,\r\n  pa.server_id AS log_server,\r\n pa.channel_id AS log_channel,\r\n 0,\r\n  SUM(pa.pay_gold),\r\n SUM(pa.post_amount),\r\n  COUNT(DISTINCT pay_user),\r\n COUNT(pa.id)\r\nFROM\r\n  pay_action pa\r\nWHERE \r\n pa.pay_status=4\r\n AND pa.pay_amount != 0\r\n  AND pa.post_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\'\r\nGROUP BY dd,log_server,log_channel ',0,'2019-01-31 11:30:55',1,0,'log_now金币\r\nlog_previous金额\r\nlog_result人数\r\nlog_data  次数','[2019-01-31 00:00:00 - 2019-01-31 23:59:59]'),(66,4,0,'时留存','','','SELECT s_d,log_server,log_channel,liucun,COUNT(log_user)\r\nFROM \r\n(\r\n  SELECT a.dd s_d,b.dd e_d,abs(round(hour(b.dd) - hour(a.dd))) as liucun,a.log_user,a.channel_id log_channel,{{server_id}} log_server\r\nFROM\r\n(\r\nSELECT DATE_FORMAT(log_time,\'%Y-%m-%d %H:00:00\') dd,log_user,channel_id \r\nFROM log_check_user c \r\nLEFT JOIN(select player_id,channel_id from player_{{server_id}}) e on e.player_id = c.log_user\r\nWHERE log_data=1 AND log_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\' AND log_server={{server_id}}\r\nGROUP BY dd,log_user,channel_id\r\n)a\r\nJOIN\r\n(\r\n  SELECT DATE_FORMAT(log_time,\'%Y-%m-%d %H:00:00\') dd,log_user,channel_id \r\nFROM log_check_user f\r\nLEFT JOIN(select player_id,channel_id from player_{{server_id}}) j on j.player_id = f.log_user\r\nWHERE log_data>1 AND log_time BETWEEN ADDDATE(\'{{sdate}}\',interval 1 hour) AND ADDDATE(\'{{edate}}\',interval 24 hour) AND log_server={{server_id}} \r\nGROUP BY dd,log_user,channel_id\r\n) b\r\nON a.log_user=b.log_user AND a.channel_id=b.channel_id AND b.dd>a.dd\r\n) d\r\nWHERE liucun<=30 AND  s_d<DATE_FORMAT(\'{{edate}}\',\'%Y-%m-%d %H:00:00\')\r\nGROUP BY s_d,log_server,log_channel,liucun',0,NULL,0,1,'时留存\r\nlog_tag 1为1时留存 2为2时留存 7为7时留存以此类推\r\n\r\n最大到23时留存','[2017-09-13 00:00:00 - 2017-09-13 23:59:59]:([])'),(67,97,0,'日首次充值用户','','','SELECT DATE(pa.post_time) AS dd,\r\n  pa.server_id AS log_server,\r\n pa.channel_id AS log_channel,\r\n 0,\r\n  SUM(pa.pay_gold),\r\n SUM(pa.post_amount),\r\n  COUNT(DISTINCT pay_user),\r\n COUNT(pa.id)\r\nFROM\r\n  pay_action pa\r\nWHERE \r\n pa.pay_status=4\r\n AND pa.pay_amount != 0\r\n  AND pa.post_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\'\r\n  AND pa.count = 1\r\nGROUP BY dd,log_server,log_channel',0,'2019-01-31 11:30:55',1,0,'log_now金币\r\nlog_previous金额\r\nlog_result人数\r\nlog_data 次数','[2019-01-31 00:00:00 - 2019-01-31 23:59:59]'),(68,97,0,'日绝对新增充值','','','SELECT DATE(pa.post_time) AS dd,\r\n  pa.server_id AS log_server,\r\n pa.channel_id AS log_channel,\r\n 0,\r\n  SUM(if(DATEDIFF(pa.player_create_time,pa.post_time) = 0,1,0))\r\nFROM\r\n pay_action pa\r\nWHERE \r\n pa.pay_status=4\r\n AND pa.pay_amount != 0\r\n  AND pa.post_time BETWEEN \'{{sdate}}\' AND \'{{edate}}\'\r\n  AND pa.count = 1\r\nGROUP BY dd,log_server,log_channel',0,'2019-01-31 11:30:55',1,0,'log_now当日注册当日充值的人数','[2019-01-31 00:00:00 - 2019-01-31 23:59:59]');
